Описание:
Арт. 91968132 Продается земельный участок в центре города Кызыла:
- 460 кв.м.;
- ВРИ: под административное здание;
- право аренды;
- зарегистрировано право собственности на строение.
В шаговой доступности школа 1, детский сад, Пенсионный фонд и прочее. 
Хорошая транспортная доступность.

ВОЗМОЖЕН ОБМЕН на автомобиль, жилое, нежилое помещение в черте города, рассмотрим варианты.
ЗВОНИТЕ, УСПЕЙТЕ ПРИОБРЕСТИ ВЫГОДНО  УЧАСТОК В ЦЕНТРЕ ГОРОДА ., 6 фото
